import React from 'react';
import Header from '../header/Header'
import Tours from '../tours/Tours';
import Footer from '../footer/Footer';
import {Routes, Route} from 'react-router-dom'
function Home() {
  return (
    <>
      <Header/>
      <Routes>
        <Route path='/' element={<Tours/>}/>
      </Routes>
      <Footer/>
    </>
    )
}

export default Home
